import './style.css'; // Make sure to adjust the path to your CSS file

const Home = () => {
  return (
    <div className="container">
      <img className="background" src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/221808/sky.jpg" alt=''/>
      
      {[...Array(60)].map((_, index) => (
        <div key={index} className="circle-container">
          <div className="circle"></div>
        </div>
      ))}
    </div>
  );
}

export default Home;
